import '../top/HeadBar.css';
import logo from '../img/Logo.png';
import { Nav } from 'react-bootstrap';


function HeadBar() {
  return (
        <div className="bg">
          <container >
              <row>
                < col xs={4}>
                  <img src={logo} alt="logo"></img>
                  <p>NKDLNalkdnl NDLNDLKSDNlkd</p>
                </col>
                < col xs={8}>
                </ col>
              </row>
          </container>     
        </div>
  );
}

export default HeadBar;
